var title_f29_28_30157="Tests for diagnosing HIV I";
var content_f29_28_30157=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F74816%7EID%2F54839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F74816%7EID%2F54839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=11\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Spectrum of available tests for the diagnosis of HIV-1 (I)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Assay",
"       </td>",
"       <td class=\"subtitle1\">",
"        CD4 counts",
"       </td>",
"       <td class=\"subtitle1\">",
"        Percent positive, sensitivity",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Routine serology",
"       </td>",
"       <td>",
"        &gt;3 mos post viral transmission",
"       </td>",
"       <td>",
"        &gt;99.3-99.7",
"       </td>",
"       <td>",
"        Readily available and inexpensive. Specificity is 99.7 (MMWR 1990; 39:380) or higher (NEJM 1988; 319:961).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Rapid test SUDS (Murex Diagnostics, Norcross, GA)",
"       </td>",
"       <td>",
"        &gt;3 mos post viral transmission",
"       </td>",
"       <td>",
"        &gt;99",
"       </td>",
"       <td>",
"        Advantage is test results are available in &le;10 min. Specificity is 99.6, so positive tests should be confirmed. Highly sensitive so negative tests do not usually require confirmation. Other rapid tests are available but are not FDA approved (Int J STD AIDS 1997; 8:192; Vox Sang 1997; 72:11).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        p24 antigen",
"       </td>",
"       <td>",
"        200-500/mm",
"        <sup>",
"         3",
"        </sup>",
"       </td>",
"       <td>",
"        10-20",
"       </td>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Measures free viral antigen by EIA and indicates high viral load. Acid treatment increases detection of p24 antigen due to its release from immune complexes. These tests are infrequently used in clinical practice due to relative insensitivity and because their use is largely supplanted by quantitative plasma HIV RNA assays",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &lt;200/mm",
"        <sup>",
"         3",
"        </sup>",
"       </td>",
"       <td>",
"        37-95",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Immune complex-disassociated p24 (ICD p24)",
"       </td>",
"       <td>",
"        200-500/mm",
"        <sup>",
"         3",
"        </sup>",
"       </td>",
"       <td>",
"        30-70",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &lt;200/mm",
"        <sup>",
"         3",
"        </sup>",
"       </td>",
"       <td>",
"        75-85",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Peripheral blood mononuclear cell culture (PMBC culture)",
"       </td>",
"       <td>",
"        &lt;500/mm",
"        <sup>",
"         3",
"        </sup>",
"       </td>",
"       <td>",
"        95-100",
"       </td>",
"       <td>",
"        Technique is viral isolation by co-cultivation of patients PBMC with PHA-stimulated donor PBMC with IL-2 over 28 days. Expensive and labor-intensive. May be qualitative or quantitative. Main use of qualitative technique is viral isolation for further analysis and for HIV detection in infants. Quantitative results correlate with stage: Mean titer is 2000/10",
"        <sup>",
"         4",
"        </sup>",
"        cells in asymptomatic patients and 2260/10",
"        <sup>",
"         4",
"        </sup>",
"        cells in patients with AIDS (NEJM 1989; 321:1621; Lancet 1998). The greatest potential use is for therapeutic monitoring in patients in clinical trials who have no detectable virus by quantitative HIV RNA.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Barlett, JG. Medical Management of HIV Infection. Port City Press, Baltimore, MD 1998.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Spectrum of available tests for the diagnosis of HIV-1 (II)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Assay",
"       </td>",
"       <td class=\"subtitle1\">",
"        CD4 counts",
"       </td>",
"       <td class=\"subtitle1\">",
"        Percent positive, sensitivity",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        DNA PCR assay",
"       </td>",
"       <td>",
"        All stages",
"       </td>",
"       <td>",
"        &gt;99",
"       </td>",
"       <td>",
"        Qualitative DNA PCR is used to detect cell-associated",
"proviral DNA; primers are commercially available from Roche",
"Laboratories. Sensitivity (&gt;99 percent) and specificity (98 percent) are reduced",
"compared to routine serology. This is not considered sufficiently",
"accurate for diagnosis without confimation (Ann Intern Med 1996;",
"124:803). Main use is viral detection in: neonatal HIV and challenged",
"or indeterminant serologic tests.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Quantitative HIV RNA",
"       </td>",
"       <td>",
"        &gt;200/mm",
"        <sup>",
"         3",
"        </sup>",
"       </td>",
"       <td>",
"        90",
"       </td>",
"       <td colspan=\"1\" rowspan=\"2\">",
"        Quantitation",
"of plasma RNA using reverse transcription and then amplification by",
"PCR. Results are in copies/mL. A 3-fold change is considered",
"significant. This is the preferred test for staging and therapeutic",
"monitoring. There are three techniques and suppliers of reagents: HIV RNA PCR (Roche), bDNA (Chiron), and NASBA (Organon).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &lt;200/mm",
"        <sup>",
"         3",
"        </sup>",
"       </td>",
"       <td>",
"        98-100",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Salivary test (OraSure Test System)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &gt;99",
"       </td>",
"       <td>",
"        Salivary collection device to collect IgG for EIA and Western blot. Advantage is avoidance of phlebotomy. Sensitivity and specificity comparable to standard serology (JAMA 1997; 227:254).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Urine test (Calypte 1)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        &gt;99",
"       </td>",
"       <td>",
"        Used for EIA test only, so positive results must be verified by serology. Must be administered by a physician. Cost is low - about $4/test.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Barlett, JG. Medical Management of HIV Infection. Port City Press, Baltimore, MD 1998.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
