var title_f29_28_30158="Algorithm for NMBAs in ICU";
var content_f29_28_30158=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F59945&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F59945&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Use of neuromuscular blocking agents (NMBAs) in the ICU",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 436px; height: 456px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Monitor paralysis using a peripheral nerve stimulator, protect eyes and pressure points, and address deep venous thrombosis prophylaxis. NMBAs should be administered using an initial bolus followed by continuous infusion. Reassess indication for continued NMBA every 12 to 24 hours.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Murray, MJ, Cowen, J, Erstad, B, et al. Clinical practice guidelines for sustained neuromuscular blockade in the adult critically ill patient. Crit Care Med 2002; 20:142. Official Journal of the Society of Critical Care Medicine, Copyright &copy; 2002 Society of Critical Care Medicine.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
